import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import EventsPage, { loader as eventLoader } from './pages/EventsPage';
import NewEventsPage, {action as newEventAction} from './pages/NewEventsPage.js';
import EditEventPage, {loader as editEventDataLoader} from './pages/EditEventPage.js';
import EventsDetailsPage, { loader as eventDetailsLoader, action as eventDeleteAction } from './pages/EventsDetailsPage.js';
import RootLayout from './pages/Root.js';
import Home from './pages/HomePage.js';
import EventsRootLayout from './pages/EventsRoot.js';
import ErrorPage from './pages/Error.js';


const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      {
        index: true, element: <Home />
      },
      {
        path:"events",
        id:"events-details",
        element:<EventsRootLayout />,
        children:[
          {
            index:true,
            element:<EventsPage/>,
            loader:eventLoader,
          },
          {
            path:":id",
            index:true,
            element: <EventsDetailsPage/>,
            loader:eventDetailsLoader,
            action:eventDeleteAction,
          },
          {
            path:":id/edit",
            element: <EditEventPage/>,
            loader:editEventDataLoader,
          }
        ],
      },
      {
        path: "events/new",
        element: <NewEventsPage />,
        action:newEventAction,
      },
    ],
  }
])

function App() {
  return <RouterProvider router={router} />;
}

export default App;
